INSERT INTO `artista` (`id`, `codigo`, `nombreArtistico`, `biografia`) VALUES
(1, 'a3476', 'Luis Fonsi', 'Luis Fonsi, nacido el 15 de abril de 1978 en San Juan, Puerto Rico, es un cantante, compositor y actor puertorriqueño. Se destacó internacionalmente con su éxito \'Despacito\' en 2017, que se convirtió en la canción más reproducida de la historia en plataformas de streaming. A lo largo de su carrera, Fonsi ha lanzado numerosos álbumes y ha recibido múltiples premios, consolidándose como una figura destacada en la música latina contemporánea.'),
(2, 'a2', 'Diego El Cigala', 'Diego el Cigala, cuyo nombre real es Diego Ramón Jiménez Salazar, nació el 27 de diciembre de 1968 en Madrid, España. Es un reconocido cantante de flamenco y bolero. Desde joven, mostró un interés apasionado por el flamenco, y a lo largo de su carrera, ha fusionado con éxito este género con otros estilos musicales, como el jazz y la música latina. Conocido por su voz única y emotiva, el Cigala ha ganado numerosos premios y ha colaborado con artistas de renombre mundial. Su habilidad para explora'),
(3, 'd127', 'David Bisbal', 'David Bisbal, nacido el 5 de junio de 1979 en Almería, España, es un cantante y actor español. Saltó a la fama en 2001 como finalista en la primera edición del programa de televisión \'Operación Triunfo\'. Desde entonces, ha consolidado una exitosa carrera musical con múltiples álbumes y numerosos éxitos. Reconocido por su potente voz y estilo pop con influencias flamencas, Bisbal ha ganado varios premios, incluyendo un Grammy Latino. Además de su éxito en la música, ha incursionado en la actuación y ha participado en proyectos tanto en televisión como en cine. Su impacto en la escena musical en español lo ha convertido en una figura destacada en la música latina.'),
(4, 'a347', 'Alejandro Sanz', 'Alejandro Sanz, nacido el 18 de diciembre de 1968 en Madrid, España, es un influyente cantante y compositor español. Reconocido por su habilidad para fusionar pop, flamenco y música latina, ha lanzado numerosos álbumes aclamados y ha ganado varios premios, incluyendo Grammy Latinos. Con éxitos como \'Corazón Partío\', Sanz es una figura destacada en la música internacional.'),
(5, 'c2197', 'Freddie Mercury', 'Freddie Mercury, cuyo nombre real era Farrokh Bulsara, nació el 5 de septiembre de 1946 en Zanzíbar, Tanzania, y falleció el 24 de noviembre de 1991 en Londres, Reino Unido. Fue el icónico vocalista y líder de la banda de rock Queen. Con su distintiva voz y carisma en el escenario, Mercury se convirtió en una leyenda del rock. Además de éxitos como \'Bohemian Rhapsody\' y \'We Will Rock You\', destacó por su estilo extravagante y versatilidad musical. Su legado perdura como uno de los artistas más influyentes en la historia de la música.'),
(6, 'a3274cd', 'Jhon Williams', 'John Williams, nacido el 8 de febrero de 1932 en Nueva York, Estados Unidos, es un renombrado compositor y director de orquesta. Es conocido por crear algunas de las bandas sonoras más emblemáticas en la historia del cine. Williams ha trabajado en más de cien películas, incluyendo éxitos como \'Star Wars\', \'Indiana Jones\', \'Jurassic Park\' y \'Harry Potter\'. A lo largo de su carrera, ha ganado múltiples premios, incluyendo varios premios de la Academia. Su contribución a la música cinematográfica le ha otorgado un lugar destacado en la cultura popular y lo ha convertido en una figura influyente en la industria del entretenimiento'),
(7, 'a37', 'Rozalen', 'Rozalén, nombre completo María Rozalén Ortuño, es una cantautora española nacida el 10 de octubre de 1986 en Albacete. Su música combina pop, canción de autor y tradición, destacando por letras emotivas y comprometidas. Álbumes notables incluyen \'Con derecho a...\' (2011) y \'Quién me ha visto...\' (2013). Reconocida por su voz expresiva y su activismo en temas sociales como la igualdad y la diversidad.'),
(8, 'd34', 'Aladdin Musical', 'Todo lo que deseas encontrar en un musical hecho realidad. Eso es Aladdín, el esperado musical creado por Disney y producido por Stage Entertainment que, cada tarde, llena de magia, espectáculo y diversión el teatro Coliseum de Madrid.\n\nConsiderado uno de los mejores musicales de todos los tiempos, esta espléndida producción que ya han disfrutado más de 14 millones de espectadores en todo el mundo te transportará al más deslumbrante de los mundos.'),
(10, 'd3434', 'Cruz Cafune', 'Cruz Cafuné nació en 1993 en la isla de Tenerife, de una madre venezolana, hija de emigrantes canarios, Diplomada en Magisterio y profesora de catequesis, y de un padre canario, Diplomado en Ciencias Empresariales y empleado de Banca hasta jubilarse. De pequeño vivía en el barrio de La Salud de Santa Cruz de Tenerife.3​ También vivió una temporada en el municipio de Icod de los Vinos y finalmente se trasladaron a Tacoronte dónde vivió la mayor parte de su infancia y adolescencia, municipio del que es originaria su familia paterna.Estudió en la Universidad de La Laguna la carrera de Filosofía, abandonándola en el último curso para dedicarse a su vocación que es la Música, posteriormente obtuvo el Título de Técnico Superior de Sonido para Audiovisuales y Espectáculos, estudios que realizó en el IES La Guancha.');

